Not much to say about this series, except that it is as awesome and hilarious as you think it is. Cable and Deadpool go on (mis)adventures, shooting things and killing people. All in a good days' work. There is plenty of fun banter along the way with Cable the deadly serious straight man to Deadpool's...Deadpool. The X-Men were transitioning from Grant Morrison to Joss Whedon at this point, with Claremont shifting back to Uncanny X-Men, and these two fan favorite fools were largely allowed to their own thing. Ther are overlaps with Civil War and other crossover events of course, right up to Messiah Complex. After that event, in 2008 both Cable and Deadpool received their own titles once again. All issues are digital; the first 34 are care of Son of Ultron-Empire, the next three are by G85-Empire and the last 13 are courtesy of Nahga-Empire. Thanks those rippers for these copies - please seed, and enjoy! :-)
